%[text] %[text:anchor:T_F7E8B9B1] # **Creating a Flight Tracking Dashboard, Part 3: Assembling the Dashboard**
%[text] %[text:anchor:H_701E9FF1] **Overview**
%[text] In the second blog post of this series, we saw how to develop a custom chart to encapsulate the 3D graphics and helper functions used to visualize the aircraft. We also discussed how a similar approach could be used to create a chart showing the current position of the aircraft on its flight route.
%[text] In this post, we'll see how assemble the flight tracking dashboard by developing a series of modular components. First, we'll develop classes to store and organize the flight data. These classes represent the backend of the dashboard. Next, we'll create a series of frontend components for visualizing and manipulating the flight data. This separation of concerns follows the model-view-controller software architecture pattern for application development, explained in more detail in this [technical article](https://www.mathworks.com/company/technical-articles/developing-matlab-apps-using-the-model-view-controller-pattern.html) \[1\]. We will make use of [GUI Layout Toolbox](https://www.mathworks.com/matlabcentral/fileexchange/47982-gui-layout-toolbox) to help organize the frontend components and allow the end user to configure the dashboard layout.
%[text] Finally, we'll assemble the various components into a dashboard application suitable for sharing with end users, and discuss the options available for deploying the dashboard, focussing on web deployment. By the end of this post, we'll have a fully functional dashboard for tracking flight data running as a web app.
%[text] All the code used in this series of blog posts is available on GitHub.
%[text:tableOfContents]{"heading":"Table of Contents"}
%%
%[text] ## Create a storage class for the flight data.
%[text] Our dashboard is designed to display flight data such as the position, altitude, and speed of the aircraft. These variables are all time series, so storing them in a `timetable` is a natural choice. We've created some (simulated) data representing a 1-hour flight between Glasgow and Stansted airports.
tt = readtimetable( "FlightPath.csv" );
disp( head( tt ) ) %[output:8461c0f4]
%[text] Timetables are flexible and enable us to freely add and remove variables. We will add some derived variables to the timetable, such as the heading, climb rate, and changes in aircraft pose over time. However, if our intention is to deploy an application to end users, we may want to limit the ways in which they can modify the application data. Using object-oriented programming means that we can provide read-only access to a data set, and guarantee that the timetable contains all the variables required for the application.
%[text] We'll create a new class `FlightPathData` to store the timetable containing the flight data. This class contains local functions `mustBeFlightDataTimetable` for validating that the timetable contains the expected variables, and `defaultFlightDataTimetable` for initializing an empty timetable of the required form.
%[text] ```matlabCodeExample
%[text] classdef FlightPathData
%[text]     %FLIGHTPATHDATA Stores data for a single flight path.
%[text] 
%[text]     properties ( Access = private )
%[text]         % Timetable containing flight path data.
%[text]         FlightDataTimetable(:, :) timetable {mustBeFlightDataTimetable} = defaultFlightDataTimetable()
%[text]     end % properties ( Access = private )
%[text] 
%[text] end % classdef
%[text] ```
%[text] We handle data input using the class constructor. This takes a filename as input, and imports the data using `readtimetable`. The validation that we've built in ensures that the imported data has all the variables we need.
%[text] ```matlabCodeExample
%[text] function obj = FlightPathData( filename )
%[text]     %FLIGHTPATHDATA Construct a FlightPathData object.
%[text] 
%[text]     arguments ( Input )
%[text]         filename(:, 1) string {mustBeFile, mustBeScalarOrEmpty} = string.empty( 0, 1 )
%[text]     end % arguments ( Input )
%[text] 
%[text]     if ~isempty( filename )
%[text]         obj.FlightDataTimetable = readtimetable( filename );
%[text]     end % if
%[text] 
%[text] end % constructor
%[text] ```
%[text] Note that a `FlightPathData` object can be constructed without entering a filename. In this case, the object will have empty properties. It's good practice to support zero-input argument syntax for a data storage class, because it means that it's easier to support arrays of objects. We might need an object array if our application supports loading multiple datasets simultaneously.
%[text] We construct a `FlightPathData` object from the file `FlightPath.csv` containing flight data.
FPD = FlightPathData( "FlightPath.csv" );
%[text] To allow client code access to the data that it needs, we need to provide a user-friendly API. For example, the dashboard will need to access the `Time` variable of the timetable, in order to create different plots. We can provide read-only access to `Time` (and all other timetable variables) by [customizing dot indexing](https://www.mathworks.com/help/matlab/ref/matlab.mixin.indexing.redefinesdot-class.html) for our class. In this case we simply pass the dot indexing onto the timetable when read access is requested, whilst preventing dot indexing from being used to assign new values.
%[text] ```matlabCodeExample
%[text] classdef FlightPathData < matlab.mixin.RedefinesDot
%[text]     %FLIGHTPATHDATA Stores data for a single flight path.
%[text] 
%[text]     methods ( Access = protected )
%[text] 
%[text]         function varargout = dotReference( obj, indexOp )
%[text] 
%[text]             [varargout{1:nargout}] = obj.FlightDataTimetable.(indexOp);
%[text] 
%[text]         end % dotReference
%[text] 
%[text]         function varargout = dotAssign( ~, ~, varargin ) %#ok<STOUT>
%[text] 
%[text]             error( "FlightPathData:DotAssignment", ...
%[text]                 "FlightPathData objects do not support dot assignment." )
%[text] 
%[text]         end % dotAssign
%[text] 
%[text]         function n = dotListLength( obj, indexOp, indexContext )
%[text] 
%[text]             n = listLength( obj.FlightDataTimetable, ...
%[text]                 indexOp, indexContext );
%[text] 
%[text]         end % dotListLength
%[text] 
%[text]     end % methods
%[text] 
%[text] end % classdef
%[text] ```
%[text] Similarly, by [redefining brace indexing](https://www.mathworks.com/help/matlab/ref/matlab.mixin.indexing.redefinesbrace-class.html), we allow clients to look up the value of a variable at a specific time during the flight. This feature is needed by the dashboard elements that show the current state of the flight.
%[text] As an example, we'll plot the airspeed throughout the flight and highlight a specific point.
figure %[output:3de43751]
plot( FPD.Time, FPD.Airspeed ) %[output:3de43751]
xlabel( "Time" ) %[output:3de43751]
ylabel( "Airspeed (knots)" ) %[output:3de43751]
title( "Airspeed" ) %[output:3de43751]
grid on %[output:3de43751]

t = datetime( 2024, 6, 30, 10, 15, 0 );
v = FPD.currentValue( "Airspeed", t );
hold on %[output:3de43751]
plot( t, v, "r*" ) %[output:3de43751]
%%
%[text] ## Create the application data model.
%[text] The `FlightPathData` class provides data storage. For a modular application such as a dashboard, we also need the ability to maintain state information. Moreover, when the end user interacts with the dashboard controls, we need to notify other parts of the application of any changes. This information sharing is achieved through the use of [events and listeners](https://www.mathworks.com/help/matlab/matlab_oop/learning-to-use-events-and-listeners.html), which also avoids unnecessary coupling between different parts of the application. Since only handle classes can maintain state and issue events, we create a handle class wrapper `FlightDashboardModel` for our data storage class `FlightPathData`.
%[text] ![](text:image:4f93)
%[text] We equip `FlightDashboardModel` with an `import` method for loading data from a file, and a `reset` method for removing the loaded data. We add the property `CurrentTime`, a scalar `datetime` value, to represent the state of the application. We equip the model with the events `CurrentTimeChanged` and `FlightDataChanged`. For more information about designing a model class, see \[1\].
%[text] 
